window.bookSummaryJSON = "<p>This island holds secrets in its dark heart, ones that threaten to destroy all of Neverland, and me with it. Peter has weakened me, Hook has beguiled me, and there’s no one else I can trust. Even so, I can’t stop my search for the fae or for the heart of the island. I have to find answers. But like everything else in Neverland, answers come at a price.</p> <p>Lily’s note: This is the third and final audiobook in the Never and Night Trilogy.</p>"; 
